        // Create a material with the texture
        const material = new THREE.MeshBasicMaterial({ map: texture, side: THREE.DoubleSide });

        // Create a mesh with the geometry and material
        const imagePlane = new THREE.Mesh(geometry, material);
        scene.add(imagePlane);

        // Position the camera
        camera.position.z = 2;

        // Variables to store mouse position
        let mouseX = 0;
        let mouseY = 0;

        // Add event listener for mouse movement
        document.addEventListener('mousemove', (event) => {
            // Calculate normalized device coordinates (-1 to +1) for mouse position
            mouseX = (event.clientX / window.innerWidth) * 2 - 1;
            mouseY = -(event.clientY / window.innerHeight) * 2 + 1;
        });

        // Animation loop
        function animate() {
            requestAnimationFrame(animate);

            // Calculate rotation based on mouse position
            const rotationX = mouseY * Math.PI / 4; // Rotate up to 45 degrees vertically
            const rotationY = mouseX * Math.PI / 4; // Rotate up to 45 degrees horizontally

            // Apply rotation to the image plane
            imagePlane.rotation.x = -rotationX;
            imagePlane.rotation.y = rotationY;

            renderer.render(scene, camera);
        }

        animate();

        // Handle window resizing
        window.addEventListener('resize', () => {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        });
    </script>
